   def interestingPages = Set(1,23,35,37,57,86,91,60,114,117,141,132,120,95,190,162,254,243,239,227,226,225,220,191,192,193,194,377,376,340,339,274,440,441,444,446,460,461,472,473)
   
   object b extends ChartBeans
   
   val outputDir = new java.io.File("build/galwaySkyAtlas")
   outputDir.mkdirs;

   val ucac3 = new Ucac3Catalog()

   pages
//     .filter(p=>interestingPages.contains(p.id))
     .map{ page =>
     println(page.id)
     
     val legh = b.legendBorder.height
     val scale  = 0.7
     
     val chart = new ChartBase(
             position = page.pos,
             width = (scale * (if(page.landscape) 2100 else 1480 )).toInt,
             height = (-legh + scale * (if(page.landscape) 1480 else 2100)).toInt,
             legendHeight = legh,
             fieldOfView = page.fov,
             colors = LightColors             
             )
     
      val starsConfig = b.stars.defaultConfig.copy(limitStarMagForce = Some(Magnitude(12)))
      b.stars.updateChart(chart,starsConfig)
      ucac3.queryByDisc(chart.position, chart.fieldOfView).foreach{s=>
       b.stars.paintObject(chart,starsConfig,s)
      }
      b.deepSky.updateChart(chart)
      b.milkyWay.updateChart(chart)
      ChartCoordinateGrid.updateChart(chart)
      val legendConfig = b.legendBorder.defaultConfig.copy(pageName = page.id.toString,starConfig = starsConfig)
      b.legendBorder.updateChart(chart,legendConfig)
      b.constelLine.updateChart(chart)
      b.constelBoundary.updateChart(chart)
      ChartLabels.updateChart(chart)
      
      //add labels which points to surrounding maps
      for{
          xi <- -1 to 1; yi <- -1 to 1;
          if(xi!=0 || yi!=0);
          x = (1 + xi ) * chart.width /2;
          y =  (1 + yi ) * chart.height / 2;
          pos = chart.wcs.deproject(x,y).get;
          otherPage = AtlasChart.uranometria(pos)
       }{         
           val text = new PText(otherPage.toString)
           text.setFont(new Font(Font.SANS_SERIF,Font.BOLD,25))
           text.setTextPaint(chart.colors.fg)           
           //center with some additional offset, so label is not placed outside of map
           text.centerBoundsOnPoint(x - xi *text.getWidth * 0.7,y - yi*text.getHeight*0.7)
           text.setTransparency(0.3f)
           chart.getLayer(Layer.fg).addChild(text)
      }
     
      
      
      chart.saveChartToImageFile(new java.io.File(outputDir,page.id+".svg"))
      chart.saveChartToImageFile(new java.io.File(outputDir,page.id+".png"))
     
   }


